import React from "react";
import { Box, Typography, TextField, Button } from "@mui/material";

const auth = () => {
  return (
    <div>
      <form>
        <Box
          display="flex"
          flexDirection={"column"}
          maxWidth={400}
          alignItems="center"
          justifyContent={"center"}
          margin="auto"
          marginTop={5}
          padding={3}
          borderRadius={5}
          boxShadow={"5px 5px 10px #ccc"}
          sx={{
            ":hover": {
              boxShadow: "10px 10px 20px #ccc",
            },
          }}
        >
          <Typography
            variant="h2"
            padding={3}
            textAlign="center"
            color={"blue"}
          >
            login
          </Typography>
          <TextField type={'text'} variant="outlined" placeholder="Name"/>
          <TextField type={'text'} variant="outlined" placeholder="Email"/>
          <TextField type={'text'} variant="outlined" placeholder="Password"/>
          <Button variant="contained" color="war" >login</Button>
        </Box>
      </form>
    </div>
  );
};

export default auth;
